function SpawnAnimProps(){
    let propWidth = 1;
    let propHeight = 1;
    let totalPixels = 0;
    
    mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_spawning_pixel_props));
    for(let y = 0; y < anim_height; ++y){
        for(let x = 0; x < anim_width; ++x){
            let idx = y * anim_width + x;
            let yPos = y * propHeight;
            let xPos = x * propWidth;
            let localPos = mod.CreateVector((propWidth * anim_width) - xPos, (propHeight * anim_height) - yPos, 0);
            let localRot = mod.CreateVector(mod.DegreesToRadians(-90),0,0);
            let worldPos = mod.Add(AnimationRootPosition, localPos);
            let propBlack = mod.SpawnObject(PropBlack, worldPos, localRot);
            // let propWhite = mod.SpawnObject(PropWhite, worldPos, localRot);
            mod.EnableSpatialObject(propBlack, !HidePropsAtStart);
            // mod.EnableSpatialObject(propWhite, !HidePropsAtStart);
            pixelPropsBlack.push(propBlack);
            // pixelPropsWhite.push(propWhite);
            totalPixels += 1;
        }
    }
    mod.DisplayHighlightedWorldLogMessage(mod.Message(mod.stringkeys.debug_total_pixel_props, totalPixels));

    propsSpawned = true;

    return pixelPropsBlack;
}

